USE [B9DA102_DATA_SOURCE]

create table Module_T (
	module_name VARCHAR(79),
	module_id VARCHAR (5) not null,
	course_id VARCHAR (6),
	duration INT,
	semester VARCHAR(15),
	CONSTRAINT module_PK PRIMARY KEY (module_id),
	CONSTRAINT fk_course FOREIGN KEY (course_id) REFERENCES Course_T (course_id),
);

